Based on the premise of The Time Traveler's Wife, a Chicago librarian (Bana) has a genetic disorder that causes him to time travel randomly. Though he often disappears from her life for long periods of time, he tries to build a romantic relationship with Clare Abshire, an artist (McAdams).[6]

Henry, the librarian, meets his future wife Clare when she is only six years old. Chronologically, however, he meets her for the first time when Clare is an adult but Henry is twenty-eight. At that point Clare has known Henry all of her adult life.
